import React from "react";

const OrderDetail = props => {
  const {
    type,
    card: { address_country, address_city, address_line1, address_zip }
  } = props;
  return (
    <div className="shipping">
      <LocationLogo className="logo" />
      <span className="section-title">{type}</span>
      <span className="country">Country: {address_country}</span>
      <span className="city">City: {address_city}</span>
      <span className="street">Street: {address_line1}</span>
      <span className="zip-code">Zipcode {address_zip}</span>
    </div>
  );
};

export default OrderDetail;
